pragma solidity ^0.4.21;

contract NameValue {
  uint[] public keys;
  mapping (uint => string) public data;

  event KeyUpdated(string key, string value);
  event KeyRemoved(string key);

  function update(string key, string value) public {
    uint key_uint = stringToUintHash(key);

    data[key_uint] = value;

    bool exists = false;
    for (uint i=0; i<keys.length; i++) {
      if (keys[i] == key_uint) {
        exists = true;
        break;
      }
    }

    if (! exists) {
      keys.push(key_uint);
    }

    emit KeyUpdated(key, value);
  }

//  function stringToUintHash(string str) private pure returns (uint) {
  function stringToUintHash(string str) public pure returns (uint) {
    bytes memory tempEmptyStringTest = bytes(str);
    if (tempEmptyStringTest.length == 0) {
      return 0;
    }

    bytes32 b;
    assembly {
      b := mload(add(str, 32))
    }

    return uint(b);
  }

//  function UintHashToString(uint number) private pure returns (string) {
  function UintHashToString(uint number) public pure returns (string) {
    bytes memory b = new bytes(32);
    for (uint i = 0; i < 32; i++) {
      b[i] = byte(uint8(number / (2**(8*(31 - i)))));
    }

    bytes memory bytesArray = new bytes(32);
    for (i = 0; i < 32; i++) {
      bytesArray[i] = b[i];
    }
    return string(bytesArray);
  }

  function get(string key) public view returns (string) {
    uint key_uint = stringToUintHash(key);
    return data[key_uint];
  }

  function remove(string key) public {
    uint key_uint = stringToUintHash(key);

    delete data[key_uint];
    uint deleteIndex;
    for (uint i=0; i<keys.length; i++) {
      if (keys[i] == key_uint) {
        deleteIndex = i;
        break;
      }
    }
    delete keys[deleteIndex];

    emit KeyRemoved(key);
  }

  function dumpKeys() public view returns (uint[]){
    return keys;
  }

  function getFromUint(uint key_uint) public view returns (string) {
    return data[key_uint];
  }

}
